import bgimage from "../images/story.jpg";
import bigarrow from "../images/bigarrow.svg"
const StoryProducts = () => {
  return (
    <section className="bg-[#FAF6EE] pt-1 pb-40 border-b border-[#111010]">
      <div className="container">
        <div className="relative mb-[152px]">
          <img className="object-cover rounded-[20px]" src={bgimage} alt="bgimage" />
          <div className="absolute top-0 p-14 text-8xl uppercase text-white">products <br />with a story</div>
          <div className="rounded-[50%] bg-[#F1EBE4] absolute py-[30px] px-[53px] right-16 bottom-[-64px] border-black border" ><img src={bigarrow} alt="bigarrow" /></div>
          <button className="uppercase absolute bg-[#FFDB5B] rounded-[1600px] px-8 py-4 text-black bottom-16 left-16 border-black border transition-all duration-3000 hover:bg-[#f7ce3b] ">watch our studio tour</button>
        </div>
        <div className="text-[#111010] text-7xl pr-28">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut lobortis ante sit amet neque tristique rutrum. Nullam a suscipit ex.</div>
      </div>
    </section>
  );
};
export default StoryProducts;
